import React from 'react';
import Grid from "@material-ui/material/Grid";

export default function Login() {
    return (
    <Grid>
        <form>
        <label>
            Email:
            <input type="text" name="email" />
        </label>
        <label>
            Password:
            <input type="text" name="password" />
        </label>
        <input type="submit" name="submit button" />
    </form>
    </Grid>

    );
}
